export default class Article{constructor(i,t,s){this.link=i,this.image=t,this.description=s}render(){const i=$(".articles");console.log(this),i.append('<li class="article" ><a href='+this.link+'"target="_blank><img src="'+this.image+'" alt=""></a><figcaption>'+this.description+"</figcaption></li>")}}